import unittest
from db_connector import DbConnector  # Replace 'your_module' with the actual module name where DbConnector is defined
import pandas as pd

class TestDbConnector(unittest.TestCase):

    def setUp(self):
        # This method will be called before each test method is run
        # You can create an instance of DbConnector here
        self.db_connector = DbConnector()

    def tearDown(self):
        # This method will be called after each test method is run
        # You can perform any cleanup here
        pass

    def test_initiate_connection(self):
        # Test the delete_from_actuals method

        # Example: Call the method with a datetime value
        self.db_connector._initiate_connection()

        self.assertNotEqual(self.db_connector.cursor, None) 
        self.assertNotEqual(self.db_connector.conn, None) 
        self.assertEqual(self.db_connector.conn.autocommit, True) 



    def test_insert_into_actuals(self):
        # Test the insert_into_actuals method
        # Create a DataFrame with test data
        sample_data = pd.DataFrame({
            'datetime': ['2021-01-15 08:00:00'],
            'load': [100.0],
            'pressure': [101.0],
            'temperature': [25.0],
            'cloud_cover': [0.5],
            'wind_direction': [180],
            'wind_speed': [10.0],
            'date': ['2023-08-28'],
            'month': [8],
            'hour': [12],
            'type_of_day': [4]
        })
        # Call the method being tested
        self.db_connector.insert_into_actuals(sample_data)

        # Add assertions to check if the data was inserted correctly
        # You can query the database to verify the inserted data

        # Example assertion (replace with actual query and assertion)
        result = self.db_connector.get_data_from_actuals(start_datetime='2021-01-15 08:00:00', end_datetime='2021-01-15 08:00:00')
        self.assertEqual(len(result), 1)  # Check if two rows were inserted



    def test_get_data_from_actuals(self):
        # Test the get_data_from_actuals method
        # Create test data in the database for querying

        # Call the method being tested
        result = self.db_connector.get_data_from_actuals(start_datetime='2021-01-10 00:00:00',
                                                         end_datetime='2021-01-14 23:00:00')

        # Add assertions to check if the query result matches the expected data
        # You can compare the 'result' DataFrame with your expected data

        expected_columns = ['datetime', 'load', 'cloud_cover', 'temperature', 'cloud_cover', 'wind_direction', 'wind_speed',
                        'date', 'month', 'hour', 'type_of_day']
        
        self.assertTrue(all(column in result.columns for column in expected_columns))
        self.assertEqual(len(result), 120) # 5 days = 24 * 5


